import React from "react";

const CourseSelector = ({ course, setCourse }) => {
  return (
    <div>
      {[1, 2, 3].map((c) => (
        <button key={c} onClick={() => setCourse(c)} style={{ margin: "5px", backgroundColor: course === c ? "#aaa" : "#eee" }}>
          {c} курс
        </button>
      ))}
    </div>
  );
};

export default CourseSelector;
